import React from 'react';


const ActivityList = ({ activity }) => {
    return (
        <select name="Activity" required>
            {activity.map((activity) => (
                <option value={activity.id}>{activity.activityName}</option>
            ))}
        </select>
    )
}


export default ActivityList;
